import React, { useEffect, useState } from 'react';
import TraineeHeader from './TraineeHeader';
import './Dashboard.css';
// ‡πÄ‡∏û‡∏¥‡πà‡∏°‡∏™‡πÑ‡∏ï‡∏•‡πå‡∏ò‡∏µ‡∏°‡∏°‡πà‡∏ß‡∏á‡πÅ‡∏ö‡∏ö‡∏´‡∏ô‡πâ‡∏≤ trainee
const themePurple = {
  background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)',
  minHeight: '100vh',
  fontFamily: 'Inter, sans-serif',
};

const TrainerDashboard = () => {
  const [videos, setVideos] = useState([]);
  const [summary, setSummary] = useState(null);
  const [traineeReport, setTraineeReport] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');
  const [profile, setProfile] = useState({ name: '', email: '', picture: '' });

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoading(true);
    // Fetch all trainers (simulate as trainer's own data for now)
    fetch('http://localhost:8000/trainers', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => res.json())
      .then(trainers => {
        // Assume the first trainer is the logged-in trainer (for demo)
        const trainer = Array.isArray(trainers) && trainers.length > 0 ? trainers[0] : null;
        if (trainer) {
          setProfile({
            name: trainer.name,
            email: trainer.email,
            picture: '/user (1).png'
          });
          // Fetch trainer profile for more details
          fetch(`http://localhost:8000/trainers/${trainer.id}`, {
            headers: { Authorization: `Bearer ${token}` }
          })
            .then(res => res.json())
            .then(profileData => {
              // Simulate summary and report from profileData
              setSummary({
                most_popular_title: 'N/A',
                most_popular_count: 0,
                total_usage: 0
              });
              setTraineeReport([]); // No trainee report in backend yet
              setVideos([]); // No videos endpoint in backend yet
            })
            .catch(() => setError('‡πÄ‡∏Å‡∏¥‡∏î‡∏Ç‡πâ‡∏≠‡∏ú‡∏¥‡∏î‡∏û‡∏•‡∏≤‡∏î‡πÉ‡∏ô‡∏Å‡∏≤‡∏£‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÇ‡∏õ‡∏£‡πÑ‡∏ü‡∏•‡πå‡πÄ‡∏ó‡∏£‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå'))
            .finally(() => setIsLoading(false));
        } else {
          setError('‡πÑ‡∏°‡πà‡∏û‡∏ö‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÄ‡∏ó‡∏£‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå');
          setIsLoading(false);
        }
      })
      .catch(() => {
        setError('‡πÄ‡∏Å‡∏¥‡∏î‡∏Ç‡πâ‡∏≠‡∏ú‡∏¥‡∏î‡∏û‡∏•‡∏≤‡∏î‡πÉ‡∏ô‡∏Å‡∏≤‡∏£‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÄ‡∏ó‡∏£‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå');
        setIsLoading(false);
      });
  }, []);

  if (isLoading) return <div className="dashboard-loading"><div className="loading-spinner"></div><p>‡∏Å‡∏≥‡∏•‡∏±‡∏á‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•...</p></div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="dashboard trainer-dashboard-bg" style={themePurple}>
      {/* Header (reuse TraineeHeader) */}
      <TraineeHeader
        user={{
          name: profile.name,
          picture: profile.picture || '/user (1).png',
        }}
        date={"1 June 2025"}
      />

      {/* Tab Bar */}
      <nav className="trainer-tabbar" style={{
        display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '2rem',
        background: 'rgba(255,255,255,0.85)',
        boxShadow: '0 2px 8px -2px #a855f722',
        borderRadius: '0 0 24px 24px',
        padding: '1rem 0', marginBottom: '2rem', position: 'sticky', top: 0, zIndex: 10
      }}>
        <button className="tab-btn" style={{background: 'none', border: 'none', color: '#7c3aed', fontWeight: 700, fontSize: '1.1rem', cursor: 'pointer'}}>Dashboard</button>
        <button className="tab-btn" style={{background: 'none', border: 'none', color: '#6366f1', fontWeight: 700, fontSize: '1.1rem', cursor: 'pointer'}}>‡∏≠‡∏±‡∏û‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</button>
        <button className="tab-btn" style={{background: 'none', border: 'none', color: '#a855f7', fontWeight: 700, fontSize: '1.1rem', cursor: 'pointer'}}>Invite Trainee</button>
        <button className="tab-btn" style={{background: 'none', border: 'none', color: '#64748b', fontWeight: 700, fontSize: '1.1rem', cursor: 'pointer'}}>Profile</button>
      </nav>

      {/* Welcome Section */}
      <section style={{textAlign: 'center', marginBottom: '2.5rem'}}>
        <div style={{background: 'white', borderRadius: 24, boxShadow: '0 2px 12px -2px #a855f722', padding: '2rem 1rem', maxWidth: 900, margin: '0 auto 2rem auto'}}>
          <h2 style={{fontSize: '2rem', fontWeight: 800, color: '#334155', marginBottom: '0.5rem'}}>‡∏¢‡∏¥‡∏ô‡∏î‡∏µ‡∏ï‡πâ‡∏≠‡∏ô‡∏£‡∏±‡∏ö, preeyanut chitkot!</h2>
          <p style={{color: '#64748b', fontSize: '1.15rem'}}>‡∏ô‡∏µ‡πà‡∏Ñ‡∏∑‡∏≠‡∏´‡∏ô‡πâ‡∏≤‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö Trainer ‡∏Ñ‡∏∏‡∏ì‡∏™‡∏≤‡∏°‡∏≤‡∏£‡∏ñ‡∏î‡∏π‡∏™‡∏£‡∏∏‡∏õ‡πÅ‡∏•‡∏∞‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£‡∏£‡∏∞‡∏ö‡∏ö‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì‡πÑ‡∏î‡πâ‡∏ó‡∏µ‡πà‡∏ô‡∏µ‡πà</p>
        </div>
      </section>

      {/* Card Section */}
      <section style={{display: 'flex', justifyContent: 'center', gap: '2rem', marginBottom: '2.5rem', flexWrap: 'wrap'}}>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>‡∏î‡∏π‡πÅ‡∏•‡∏∞‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏ó‡∏µ‡πà‡∏Ñ‡∏∏‡∏ì‡∏≠‡∏±‡∏û‡πÇ‡∏´‡∏•‡∏î</p>
          <button style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>‡∏î‡∏π‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏ó‡∏±‡πâ‡∏á‡∏´‡∏°‡∏î</button>
        </div>
